INSERT INTO `uah_mad_g5`.`tbl_noticia` (`idNoticia`, `permalink`, `titulo`, `imagen`, `idUsuario`, `texto`) VALUES ('1', '0', '¿Qué pasó con Domenicali que enfadó a Red Bull F1?', 'data:image/jpeg;base64,', '1', 'El mismo día que Red Bull presentaba su decoración para la temporada 2023, reveló su asociación con Ford de cara a 2026. El regreso de una firma histórica (y laureada) a la categoría dos décadas después merecía un evento por todo lo alto, y por ello estaba invitado el director general de la Fórmula 1, Stefano Domenicali.');
INSERT INTO `uah_mad_g5`.`tbl_noticia` (`idNoticia`, `permalink`, `titulo`, `imagen`, `idUsuario`, `texto`) VALUES ('2', '0', 'Verstappen, animado por los nuevos neumáticos Pirelli de F1 2023', 'data:image/jpeg;base64,', '1', 'El piloto de Red Bull es conocido por preferir un eje delantero más efectivo para que los monoplazas sean nerviosos en la parte trasera. Ese rasgo era el contrario con el que el RB18 empezó en la temporada 2022 debido a la combinación de sobrepeso y subviraje de la nueva generación de neumáticos Pirelli.');
INSERT INTO `uah_mad_g5`.`tbl_noticia` (`idNoticia`, `permalink`, `titulo`, `imagen`, `idUsuario`, `texto`) VALUES ('3', '0', 'McLaren cambia el nombre de su F1 y muestra la primera imagen', 'data:image/webp;base64,', '1', 'Como era de esperar, el coche de la escudería de Woking recibiría el nombre de MCL37 para continuar con la línea que siguió a los míticos \'MP4\', pero a pocos días de su presentación, McLaren decidió sorprender a todos los aficionados con una nueva nomenclatura. A través de un vídeo publicado en sus redes sociales, los británicos anunciaron que su criatura se llamaría MCL60, en honor a las seis décadas de historia de la firma.');
INSERT INTO `uah_mad_g5`.`tbl_noticia` (`idNoticia`, `permalink`, `titulo`, `imagen`, `idUsuario`, `texto`) VALUES ('4', '0', 'Russell: \"He asumido que todo lo que diga va a ser analizado con lupa\"', 'data:image/webp;base64,', '1', 'El joven británico sorprendió a propios y extraños en el Gran Premio de Singapur de 2022, cuando cuestionó la agresividad de Mick Schumacher en su batalla por la posición.');
INSERT INTO `uah_mad_g5`.`tbl_noticia` (`idNoticia`, `permalink`, `titulo`, `imagen`, `idUsuario`, `texto`) VALUES ('5', '0', 'Bottas reconoce que sufrió un trastorno alimentario en F1', 'data:image/webp;base64,', '1', 'El piloto de Alfa Romeo estuvo en la presentación de su equipo para la temporada 2023 de Fórmula 1, donde revelaron el aspecto del C43. Será la undécima campaña del finlandés en el Gran Circo, una categoría que le ha visto crecer desde que se estrenó con Williams hace una década y en la que ha conseguido diez victorias hasta la fecha, todas con Mercedes.');
